/**
 * The `ARTrackableType` enum describes the types of trackable that can be detected and tracked. Used by `ARTrackable.type`.
 * @property FEATURE_POINT The trackable is a feature point.
 * @property HORIZONTAL_PLANE The trackable is a horizontal plane.
 * @property VERTICAL_PLANE The trackable is a vertical plane.
 */
declare interface ARTrackableType{
FEATURE_POINT,
HORIZONTAL_PLANE,
VERTICAL_PLANE,
}
